import React from 'react';
import photo from '../headshot.jpg'
import cv  from '../rast_CV.pdf'
import {
    AboutPageContainer,
    Photo,
    PhotoBackground,
    AboutContent,
    AboutText,
    Name
} from './about.styled'

const About = () => {
    return (
        <AboutPageContainer>
            <PhotoBackground />
            <Photo src={photo} alt="Jacob Rast Picture" width="200px" height="200px"></Photo>      
            <AboutContent>
                <Name>Jacob Rast</Name>
                <AboutText>Hello, I'm Jacob. Master student in</AboutText>
                <a href={cv} download="jacob-rast-cv.pdf">Download link</a>
                </AboutContent>   
        </AboutPageContainer>
    )
}

export default About;
